"""
编写代码，移除未排序链表中的重复节点。保留最开始出现的节点。

示例1:

 输入：[1, 2, 3, 3, 2, 1]
 输出：[1, 2, 3]
示例2:

 输入：[1, 1, 1, 1, 2]
 输出：[1, 2]
提示：

链表长度在[0, 20000]范围内。
链表元素在[0, 20000]范围内。
进阶：

如果不得使用临时缓冲区，该怎么解决？
"""

# Definition for singly-linked list.
from exercise.myUtils import list2ListNode, listNode2List, timer


class ListNode:
    def __init__(self, x):
        self.val = x
        self.next = None

"""
此题最简单高效到解法是使用set
如果不使用额外存储空间，则双重循环
"""
class Solution:
    @timer
    def removeDuplicateNodes(self, head: ListNode) -> ListNode:
        s = set()
        root = head
        pre = head
        while head:
            if head.val in s:
                pre.next = head.next
            else:
                pre = head
                s.add(head.val)

            head = head.next

        return root
